class Solution:
    def check(self,num,s):
        for i in num:
            if i not in s:
                return False
        return True
    def remove_char(self,s,num):
        for i in num:
            j=0
            while j<len(s):
                if s[j]==i:
                    if j==0:
                        s=s[1:]
                    elif j==len(s):
                        s=s[:-1]
                    else:
                        s=s[:j]+s[j+1:]
                    break
                j+=1
        return s

    def originalDigits(self, s: str) -> str:
        ls_num_char=['zero', 'four', 'five', 'eight', 'six', 'nine', 'seven', 'one', 'two', 'three']
        num=[0,4,5,8,6,9,7,1,2,3]

        ls=[]
        for i in range(len(ls_num_char)):
            while self.check(ls_num_char[i],s):
                s=self.remove_char(s,ls_num_char[i])
                ls.append(num[i])
        ls.sort()
        final=''
        for i in ls:
            final+=str(i)
        return final

